import React from 'react';
import Card from './Cards';
import Sdata from './Sdata';

function App(){
    return(
        <>
            <h1 className='headingStyle'>List of 5 best Netflix Shows</h1>
            {Sdata.map( (val) => {
                return (
                    <Card 
                        imgSrc = {val.imgSrc}
                        title = {val.title}
                        Sname = {val.Sname}
                        link = {val.link}
                    />
                );
            }
            )}
        </>
    );
}

export default App;
